import React from 'react';
import './PersonalCare.css';

const products = [
  {
    name: 'Aloe Vera Face Gel',
    description: 'Hydrates and soothes skin. Suitable for all types.',
    price: 180,
    image: '/images/aloe-vera.jpg',
  },
  // Add more products
];

const SkinCare = () => {
  return (
    <div className="personal-care-container container py-4">
      <h2 className="text-center mb-4">ðŸ§´ Skin Care Products</h2>
      <div className="row">
        {products.map((product, index) => (
          <div key={index} className="col-md-4 mb-4">
            <div className="card h-100 shadow-sm">
              <img
                src={product.image}
                alt={product.name}
                className="card-img-top"
                style={{ height: '200px', objectFit: 'cover' }}
              />
              <div className="card-body">
                <h5 className="card-title text-primary">{product.name}</h5>
                <p className="card-text text-muted">{product.description}</p>
                <p className="fw-bold">â‚¹{product.price}</p>
                <button className="btn btn-outline-success w-100">Add to Cart</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SkinCare;
